import React, { useState , useEffect} from "react";
import { fetchDailyData } from '../../api/index.js'

const Chart = () =>{
    const[dailyData , setDailyData] = useState({});

    useEffect(()=>{
        const fetchAPI = async () =>{
          setDailyData(await fetchDailyData());
        }
    });
    return (
        <h1>Chart</h1>
    )
}

export default Chart;
